const ContactApi = [
    {
        ContactTitle: [
            {
                id: 0,
                title: 'актуально'
            },
            {
                id: 1,
                title: 'Получайте полезные рассылки о путешествиях'
            }
        ],
        ContactInput: [
            {
                id: 0,
                text: 'Введите e-mail адрес',
                inputText: 'name@domain.com',
                buttonText: 'Подписаться на новости',
                textP: 'подписываясь на новости, вы автоматически соглашаетесь с условиями обработки персональных данных и правилами рекламных рассылок'
            },
        ]
    }
]
export default ContactApi
